@Loopha: where fragrance, function, and design converge.
 
Loopha’s hand + body wash features plant-based surfactants and nourishing ingredients like jojoba esters and glycerin to complement its atmospheric scent. 

The result? A luxurious lather that cleanses without compromising on experience or efficacy.

A very special few days with @aerinbeauty in the English Countryside…

@Aerin welcomed 25 influencers, creators and editors to celebrate the launch of AERIN’s newest fragrance, Les Jardins Botaniques Wisteria, inspired by Aerin’s love of flowers and gardens around the world.

Guests immersed themselves in the World of AERIN with a fragrance masterclass hosted by @aerin and @jessicadiner, a floral arranging workshop with @willowcrossleycreates, and a whimsical summer dinner.
